import React from 'react';
// Corrected: Neenga create panna StudentList-a inga import panrom
import StudentList from '../components/StudentList'; 

const Dashboard = () => {
  return (
    <div style={{ display: 'flex', minHeight: '100vh', fontFamily: 'Arial, sans-serif' }}>
      
      {/* Sidebar */}
      <div style={{ width: '260px', backgroundColor: '#f4f7e6', padding: '25px', borderRight: '1px solid #ddd' }}>
        <h2 style={{ color: 'blue', marginBottom: '40px' }}>ADMIN</h2>
        <p>Dashboard</p>
        <p style={{ color: 'purple', fontWeight: 'bold', textDecoration: 'underline' }}>students</p>
        <p>Subjects</p>
        <p>Result</p>
      </div>

      {/* Content Area */}
      <div style={{ flex: 1, padding: '40px' }}>
        <div style={{ display: 'flex', marginBottom: '30px' }}>
          {/* Tag name-aiyum StudentList-nu mathiyachu (Ippo error varathu) */}
          <StudentList title="Regd users" count="10" />
          <StudentList title="Subject Listed" count="12" />
        </div>

        <button style={{ backgroundColor: 'blue', color: 'white', padding: '10px 20px', border: 'none', borderRadius: '4px', marginBottom: '20px' }}>
          Add student
        </button>

        <h2>Hello Admin</h2>

        <div style={{ display: 'flex', border: '1px solid #eee', borderRadius: '12px', padding: '30px', boxShadow: '0 4px 12px rgba(0,0,0,0.05)' }}>
          <div style={{ flex: 1 }}>
            <h3>Account details</h3>
            <p>ðŸ‘¤ <b>Arun Kumar</b></p>
            <p>ðŸ“§ arunkumar@email.com</p>
          </div>
          <div style={{ flex: 1, borderLeft: '1px solid #eee', paddingLeft: '30px' }}>
            <h3>Edit</h3>
            <input type="text" defaultValue="arun_dev" style={{ width: '100%', marginBottom: '10px' }} />
            <button style={{ backgroundColor: '#1a1a7e', color: 'white', padding: '10px 20px', border: 'none' }}>Update</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
